export async function Download() {
    let url = document.getElementById("urlinput").value;


    const data = { url: url };
    const options = {
    method: 'POST',
    headers: {
        'Content-Type': 'application/json'
    },
    body: JSON.stringify(data)
    };

    let response = await fetch("http://localhost:5000/download", options);
  }
